#### Definitions

**1** Â  In this Act:

**"goods"** includes personal property of every description that may be deposited with a warehouser as bailee;

**"security interest"** means an interest in goods that secures payment or performance of an obligation;

**"warehouser"** means a person lawfully engaged in the business of storing goods as a bailee for hire.

#### Warehouse lien

**2** Â  (1) Subject to section 3, every warehouser has a lien on goods deposited with the warehouser for storage, whether deposited by the owner of the goods or by the owner's authority, or by any person entrusted with the possession of the goods by the owner or by the owner's authority.

(2) The lien is for the amount of the warehouser's charges for all of the following:

(a) all lawful charges for storage and preservation of the goods;

(b) all lawful claims for money advanced, interest, insurance, transportation, labour, weighing, coopering and other expenses in relation to the goods;

(c) all reasonable charges for any notice required to be given under this Act, and for notice and advertisement of sale, and for sale of the goods if default is made in satisfying the warehouse lien.

#### Enforcement of lien by sale of goods

**4** Â  (1) In addition to all other remedies provided by law for the enforcement of liens or for the recovery of warehouser's charges, a warehouser may sell by public auction, in the manner provided in this section, any goods on which the warehouser has a lien for charges which have become due.

(2) The warehouser must give written notice of the warehouser's intention to sell to the following persons:

(a) the person liable as a debtor for the charges for which the lien exists;

(b) the owner of the goods;

(c) any person who has a security interest in the goods where a financing statement with respect to the security interest is registered at the date of the deposit of the goods;

(d) any other person known by the warehouser to have or claim an interest in the goods.

(3) The notice must contain the following:

(a) a brief description of the goods;

(b) a statement showing the location of the warehouse where the goods are stored, the date of their deposit with the warehouser and the name of the person by whom they were deposited;

(c) an itemized statement of the warehouser's charges showing the sum due at the time of the notice;

(d) a demand that the amount of the charges as stated in the notice and further charges as may accrue must be paid on or before a day mentioned, not less than 21 days from the delivery of the notice if it is personally delivered, or from the time when the notice should reach its destination according to the due course of mail if it is sent by mail;

(e) a statement that, unless the charges are paid within the time mentioned, the goods will be advertised for sale and sold by public auction at a time and place specified in the notice.

(4) If the charges are not paid on or before the day mentioned in the notice, an advertisement of the sale, describing the goods to be sold, and stating the name of the person liable as debtor for the charges for which the lien exists and the time and place of the sale, must be published at least once a week for 2 consecutive weeks in a newspaper published in British Columbia and circulating in the locality where the sale is to be held.

(5) The sale must be held not less than 14 days from the date of the first publication of the advertisement.
